import logo from './logo.svg';
import './App.css';
import Header from './components/Header';
import Talks from './components/Talks';
import Footer from './components/Footer';
import LoginModal from './components/LoginModal';
import {useState} from "react";

function App() {

  const [showLoginModal, changeLoginModal] = useState(false);

  //change modal
  const changeModal = () => {
    console.log("Modal Change", showLoginModal)
    changeLoginModal(true)
    console.log("Modal Change", showLoginModal)
  }

  return (

    <div>
      <Header changeModalFn={changeModal} />
      <Talks changeModalFn={changeModal}  />

      {showLoginModal ? <LoginModal show={true} /> : <LoginModal show={false} /> }
      {/* <LoginModal /> */}
      <Footer />
    </div>
  );
}

export default App;
